from typing import List
import collections
import heapq

# You are given a network of n nodes, labeled from 1 to n. 
# You are also given times, a list of travel times as directed edges times[i] = (ui, vi, wi), where ui is the source node, vi is the target node, 
# and wi is the time it takes for a signal to travel from source to target.
# We will send a signal from a given node k. Return the minimum time it takes for all the n nodes to receive the signal. 
# If it is impossible for all the n nodes to receive the signal, return -1
class Solution:
    def networkDelayTime(self, times: List[List[int]], n: int, k: int) -> int:
        # Initialize the graph
        graph = collections.defaultdict(list)
        # Fill the graph
        for u, v, w in times:
            graph[u].append((v, w))
        # Initialize the heap
        heap = [(0, k)]
        # Initialize the distance
        distance = collections.defaultdict(int)
        # Iterate the heap
        while heap:
            # Pop the heap
            time, node = heapq.heappop(heap)
            # If the node is not visited
            if node not in distance:
                # Update the distance
                distance[node] = time
                # Iterate the graph
                for v, w in graph[node]:
                    # Push the heap
                    heapq.heappush(heap, (time + w, v))
        # If the distance is not equal to the number of nodes
        if len(distance) != n:
            # Return -1
            return -1
        # Return the maximum distance
        return max(distance.values())

